// src/components/layout/MainPage.js
import React from 'react';
import { CssBaseline } from '@mui/material';
import MainPageContent from './mainPageContent';

const MainPage = () => {
  return (
    <SidebarContainer>
      <CssBaseline />
      <MainPageContent />
    </SidebarContainer>
  );
};

export default MainPage;
